/* Практическое задание по теме “Операторы, фильтрация, сортировка и ограничение. Агрегация данных” */

-- 1. Пусть задан некоторый пользователь (id = 1). Из всех пользователей соц. сети найдите человека, который 
-- больше всех общался с выбранным пользователем (написал ему сообщений)

INSERT INTO messages(from_user_id,to_user_id,body) VALUES
	(1,4,'sometext1'),
	(4,1,'sometext2'),
	(1,4,'sometext3'),
	(1,4,'sometext4'),
	(1,19,'sometext5'),
	(19,1,'sometext6'),
	(1,20,'sometext7'),
	(1,21,'sometext8'),
	(25,1,'sometext9'),
	(25,1,'sometext10');

SELECT m.from_user_id, COUNT(*) AS messages
FROM users u 
JOIN messages m ON m.to_user_id = u.id
WHERE m.to_user_id = 1
GROUP BY m.from_user_id
ORDER BY messages DESC
LIMIT 1


-- 3. Подсчитать общее количество лайков, которые получили пользователи младше 18 лет..

INSERT INTO likes(user_id,media_id) VALUES
	(2,4),
	(4,1),
	(3,4),
	(1,5),
	(4,5),
	(5,10),
	(41,99),
	(42,90),
	(90,2),
	(99,2);

SELECT COUNT(*) 
FROM likes l 
JOIN media m ON l.media_id = m.id
JOIN users u ON m.user_id = u.id 
JOIN profiles p ON p.user_id = u.id
WHERE TIMESTAMPDIFF(YEAR,p.created_at ,NOW()) < 18


-- 3.Определить кто больше поставил лайков (всего) - мужчины или женщины?
	
SELECT p.sex,COUNT(*) 
FROM likes l 
JOIN media m ON l.media_id = m.id
JOIN users u ON m.user_id = u.id 
JOIN profiles p ON p.user_id = u.id
GROUP BY p.sex
ORDER BY p.sex
LIMIT 1




